pragma solidity ^0.8.24;

/// @title  IMaintenance
/// @notice Interface for the Maintenance precompile
interface IMaintenance {
    /**
     * @notice Enables/disables support for the non-EIP155 txs without replay protection.
     * @param value The new value of the flag.
     * @dev Must be called by contract owner.
     */
    function setSupportNonEIP155Txs(bool value) external returns (bool);

    /**
     * @notice Checks status of support for the non-EIP155 txs without replay protection.
     * @return True if non-EIP155 txs are supported. False otherwise.
     */
    function getSupportNonEIP155Txs() external view returns (bool);

    /**
     * @notice Updates the byte code associated with a precompile
     * @param precompile The precompile contract address
     * @param code The new byte code to use
     * @dev Must be called by contract owner.
     */
    function setPrecompileByteCode(address precompile, bytes calldata code) external returns (bool);
}

interfaces/IPriceOracle.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

/// @title  IPriceOracle
/// @notice Interface for the Price Oracle precompile.
/// @dev This is actually the ChainlinkAggregatorV3Interface interface.
interface IPriceOracle {
    /**
    * @return Decimal places of the precision used to represent the price.
    *         E.g. if decimals is 18, the price is represented with the 10^18 precision.
    */
    function decimals() external view returns (uint8);

    /**
    * @notice Returns the price from the last update tick (round) of the oracle.
    * @return roundId The round ID.
    * @return answer The price represented in the 10^decimals precision.
    * @return startedAt Start timestamp of the update tick.
    * @return updatedAt End timestamp of the update tick.
    * @return answeredInRound Deprecated - Previously used when answers could
    *         take multiple rounds to be computed.
    */
    function latestRoundData()
        external
        view
        returns (
            uint80 roundId,
            int256 answer,
            uint256 startedAt,
            uint256 updatedAt,
            uint80 answeredInRound
        );
}

